	<Layout>
		<div className="py-5 position-absolute" style={{top:'45%', left: '45%'}}>
			<div className="text-center">
				<h1 className="font-weight-bold" style={styles}>Weather Finder</h1>
			</div>
		</div>
	</Layout>
)

export default Index;
